import React, { useState } from "react";

function Student({stdName,setStdName,stdId,setStdId }) {
  const handleNameChange = (e) => {
    setStdName(e.target.value);
  }
  const handleIdChange = (e) => {
    setStdId(e.target.value);
  }
  return(
    <div>
      <label htmlFor="stdName">
        <input type="text" name="stdName" onChange={(e) => handleNameChange()} value={stdName}/>
      </label>
      <label htmlFor="stdId">
        <input type="text" name="stdId" onChange={(e) => handleIdChange()} value={stdId}/>
      </label>
    </div>
  )
}


export default Student;
